import React from "react";
import { BrowserRouter as Routers, Route, Routes, Link } from "react-router-dom";
import { useState, useEffect } from "react";
import axios from 'axios';

import Personalized_data_progresser from "./Personalized_data_progresser"
import Personalized_data_ProfileSection from "./Personalized_data_ProfileSection"

const Personalized_data_Part = () => {

    const [ UserData, updateUserdata ] = useState();

    useEffect(()=>{
        axios.get('https://dummyjson.com/users').then(
            
            (result)=>{ 
                const CertifiedUsers = result.data.users[0].id
                updateUserdata(CertifiedUsers)

                // 해당 부분은 개인정보 인증 이후에 서버단에서 정제한 후의 데이터를 전송하는 것으로 기획
                // 차우선적으로 프론트단에서 정제하여 다룰 수 있게끔만 한 것임
             }
        )
    },[])

        return <React.Fragment>
            <Routers>
                <Personalized_data_ProfileSection id={UserData}/>
                <Personalized_data_progresser id={UserData}/>
            </Routers>

        </React.Fragment>

}

export default Personalized_data_Part;
